import React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';

function MenuItem(){
    return <div>
        <Card sx={{ width: 345 }}>
            <CardMedia
                component="img"
                height="345"
                image="https://media.istockphoto.com/photos/red-cup-of-cappucino-with-beautiful-latte-art-picture-id1217410626?k=20&m=1217410626&s=612x612&w=0&h=FtyuwKT0C1IN0q5JQ2qZFVD5o1H6crzckztwgLM98qU="
                alt="latte item"
            />
            <CardContent>
                <Typography>
                    Latte
                </Typography>
            </CardContent>
        </Card>
    </div>
}

export default MenuItem;
